  // Undo the alternating reversals
  for (let i=0;i<chunks.length;i++){ if(i%2===1) chunks[i] = chunks[i].split('').reverse().join(''); }
  const b64 = chunks.join('');

  // atob -> Uint8Array
  function b64ToBytes(b64) {
    const bin = atob(b64);
    const len = bin.length;
    const out = new Uint8Array(len);
    for (let i=0;i<len;i++) out[i] = bin.charCodeAt(i) & 255;
    return out;
  }

  // XOR decrypt using key
  function xorBytes(arr, keyBytes){
    const out = new Uint8Array(arr.length);
    const klen = keyBytes.length;
    for(let i=0;i<arr.length;i++) out[i] = arr[i] ^ keyBytes[i % klen];
    return out;
  }

  // Hex -> Uint8Array
  function hexToBytes(hex){
    const out = new Uint8Array(hex.length/2);
    for(let i=0;i<out.length;i++) out[i] = parseInt(hex.substr(i*2,2),16);
    return out;
  }

  // Basic anti-tamper: delay if DevTools is detected (best-effort only)
  function devtoolsOpen(){
    const start = performance.now();
    debugger;
    return performance.now() - start > 50;
  }

  // small jitter when devtools likely open
  let jitter = 0;
  try { if (devtoolsOpen()) jitter = 750 + Math.floor(Math.random()*750); } catch (e) { }

  setTimeout(()=>{
    try {
      const keyHex = "f9bf91fa2d6005ba9b4b38850138211993af482689";
      const keyBytes = hexToBytes(keyHex);
      const enc = b64ToBytes(b64);
      const dec = xorBytes(enc, keyBytes);
      // UTF-8 decode
      const text = new TextDecoder('utf-8').decode(dec);
      document.open();
      document.write(text);
      document.close();
    } catch(err) {
      document.body.innerHTML = '<div class="c"><div class="s">Lỗi giải mã</div><code>'+String(err)+'</code></div>';
    }
  }, jitter);
})();
